import React from "react";
import { Link } from "react-router-dom";

function Drone() {
  return (
    <div //parent div style of ALL ROWS
      style={{
        display: "grid",
        gridTemplateRows: "repeat(3, minmax(100px, auto))", // use grid-auto-rows instead of gridTemplateRows
        gridGap: "10px",
        margin: "0 auto",
        maxWidth: "90%",
      }}
    >
      <div // Parent div for row 1 start here
        style={{
          backgroundColor: "transparent",
          height: "100%",
          display: "flex",
          flexDirection: "row", // this makes it so all the boxes in column 1 are stacked like a column on top of each other
          alignItems: "center",
          justifyContent: "center",
          flex: "1", // Give equal width to each box
          minWidth: "calc(33.333% - 10px)", // Calculate the width for each box, considering the space between them
          margin: "0 5px", // Set horizontal margin to 5px for equal spacing
          marginBottom: "10px", // Set vertical margin between wrapped boxes
        }}
      >
        Row 1
      </div>
      {/* parent div END for row 1 above */}
      <div //parent div style for row 2
        style={{
          backgroundColor: "#ccc",
          height: "200px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        Row 2
      </div>
      {/* parent style for row 2 ends above */}
      <div //parent style for row 3
        style={{
          backgroundColor: "#ccc",
          height: "200px",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        Row 3
      </div>
      {/* parent ends for row 3 above */}
    </div>
    // END OF PARENT DIV OF ALL ROWS ABOVE
  );
}

export default Drone;
